import React, {useContext, useState, useEffect} from 'react';
import {MyContext} from "../myContext/MyContext";
import Cookies from "js-cookie";
import Card from "../components/Card";


function AllData() {

	let [transactions, setTransactions] = useState([]);

	const {
		authenticateWithAPI,
		setError,
	} = useContext(MyContext);

	useEffect(()=> {
		getAlldata();
	}, []); 

	async function getAlldata() {

		let userToken = Cookies.get("token");
		if (!userToken) {
			authenticateWithAPI();
			userToken = Cookies.get("token");
		}

		let username = Cookies.get("username");
		if (!username) {
			return;
		}

		const API_URL = process.env.NEXT_PUBLIC_API_URL || "http://localhost:1337";
		const response = await fetch(`${API_URL}/transactions/alltransactions`, {
			method: "POST",
			headers: userToken && { Authorization: `Bearer ${userToken}` },
			body: JSON.stringify({
				username: username
			}),
		});

		if (!response.ok) {
			console.log(response.statusText)
			setError(response.statusText);
			} else {
				const responseObj = await response.json();
				const error = responseObj.error;
				if (error) {
					setError(error);
					return;
				}
				setTransactions(responseObj);
			};
		};
		
		return (
			<Card
				bgcolor="warning"
				header="All Data"
				body={
					<><><>
						<>
							<table>
								<tbody>
									<tr>
										<th>To</th>
									</tr>
									{transactions.map((transaction, index) => {
										return (
											<tr key={index} className="alldataTo" style={{backgroundColor:"red", display:"inline-block"}}>
												<td>{transaction.to}</td>
											</tr>
										);
									})}
								</tbody>
							</table> 
						</>
						<>
							{transactions.map((transaction, index) => {
								return (
									<div key={index} className="alldataFrom" style={{backgroundColor:"yellow"}}>
									<table>
										<tbody>
											<tr>
												<th>From</th>
											</tr>
											<tr>
												<td>{transaction.from}</td>
											</tr>
										</tbody>
									</table>
									</div>
							
								);
							})}
						</>
					</><>
							{transactions.map((transaction, index) => {
								return (
									<div key={index} className="alldataAmount" style={{backgroundColor:"green"}}>
										<table>
											<tbody>
												<tr>
													<th>Amount</th>
												</tr>
												<tr>
													<td>{transaction.amount}</td>
												</tr>
											</tbody>
										</table>
									</div>
								);
							})}
						</></><>
							{transactions.map((transaction, index) => {
								return (
									<div key={index} className="alldataDate" style={{backgroundColor:"pink"}}>
										<table>
											<tbody>
												<tr>
													<th>Date</th>
												</tr>
												<tr>
													<td>{transaction.createdAt}</td>
												</tr>
											</tbody>
										</table>
									</div>
								);
							})}
						</></>

				}
			/>
		)
};

	
export default AllData;
